- request:
    body: '{"input": ["And unlike the $2 Trillion tax cut passed in the previous administration
      that benefitted the top 1% of Americans, the American Rescue Plan helped working
      people\u2014and left no one behind.   And it worked. It created jobs. Lots of
      jobs.   In fact\u2014our economy created over 6.5 Million new jobs just last
      year, more jobs created in one year   than ever before in the history of America.   Our
      economy grew at a rate of 5.7% last year, the strongest growth in nearly 40
      years, the first step in bringing fundamental change to an economy that hasn\u2019t
      worked for the working people of this nation for too long.    For the past 40
      years we were told that if we gave tax breaks to those at the very top, the
